from math import gcd

def count_intersecting_wires(n, poles):
    ks = {}
    ct = 1
    res = 0
    ls = set()
    for i in range(n):
        for j in range(i + 1, n):
            dy = poles[j][1] - poles[i][1]
            dx = poles[j][0] - poles[i][0]
            if dx < 0:
                dx *= -1
                dy *= -1
            elif dx == 0:
                dy = abs(dy)
            g = gcd(abs(dx), abs(dy))
            k = (dx // g, dy // g)
            (x, y) = (poles[i][0], poles[i][1])
            if dx == 0:
                a = (poles[i][0], 0)
            else:
                cl = abs(x) // k[0]
                if x >= 0:
                    x -= cl * k[0]
                    y -= cl * k[1]
                else:
                    x += cl * k[0]
                    y += cl * k[1]
                    while x < 0:
                        x += k[0]
                        y += k[1]
                a = (x, y)
            if (k, a) in ls:
                continue
            else:
                ls.add((k, a))
            ct += 1
            if k not in ks:
                ks[k] = 1
            else:
                ks[k] += 1
            res += ct - ks[k]
    return res

